// web/src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar.js';
import Home from './pages/Home';
import Minecraft from './pages/Minecraft';
import ProjectZomboid from './pages/ProjectZomboid';
import AssettoCorsa from './pages/AssettoCorsa';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
    return (
        <Router>
            <Header />
            <Navbar />
            <Switch>
                <Route exact path="/" component={Home} />
                <Route path="/minecraft" component={Minecraft} />
                <Route path="/project-zomboid" component={ProjectZomboid} />
                <Route path="/assetto-corsa" component={AssettoCorsa} />
            </Switch>
            <Footer />
        </Router>
    );
}

export default App;
